import React, { Component } from 'react';
import dynamic from 'next/dynamic';

const INFO_MESSAGES =
  '안녕하세요.웹 개발자 윤인배 입니다.React와 Django를 좋아합니다.';

const Typewriter = dynamic(() => import('typewriter-effect'), {
  ssr: false
});

const printMessages = () => {
  const messages = INFO_MESSAGES.split('.');
  let jsxArray = [];
  for (let m = 0; m < messages.length - 1; m++) {
    messages[m] += '.';
    console.log(messages[m]);
    jsxArray.push(
      <Typewriter
        options={{
          strings: [messages[m]],
          autoStart: true
        }}
      />
    );
    jsxArray.push(<br></br>);
  }
  return jsxArray;
};

console.log(printMessages(INFO_MESSAGES));

class Index extends Component {
  render() {
    return;
  }
}

export default Index;
